var b="url",c="平台机构交易流水.html",d="generationDate",e=new Date(1688534961172.17),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="page",t="packageId",u="c4a4c65a8c4a441fa90b09d4b4c07f7b",v="type",w="Axure:Page",x="平台机构交易流水",y="notes",z="annotations",A="fn",B="1",C="ownerId",D="5b8889c26c174e47a4eee25d069cfc97",E="label",F="合计现金：xx元",G="说明",H="<p><span>读取当前查询条件的列表的交易现金的合计总金额</span></p>",I="2",J="1cc01d6070404ef696a886c3f2fecc20",K="<p><span>除了发送短信和退款外的订单类型都要显示退款按钮，点击退款，需要填写退款说明和上传退款凭证，退款成功后给当前机构生成一条新的订单退款记录，并且在相应的现金余额增加对应的余额。并且修改当前订单类型为退款。</span></p><p><span>（用户订单和后台开课对应的是产品退款，充值短信和充值余额对应的是平台结算订单里的平台退款）</span></p>",L="3",M="f2d19337c36041ccb71f1f76a65d9e35",N="子订单编号",O="<p><span>订单下产生的其他操作，如退款</span></p>",P="4",Q="9633cc42e7df4df0a59762e4a3c64d90",R="机构订单号",S="<p><span>只有后台开课和用户订单的才有，读取机构对应的用户订单号</span></p>",T="5",U="d893462ae89743bfa108c97584314e83",V="订单编号",W="<p><span>对应机构订单的订单编号</span></p>",X="6",Y="2cb61010a6c24638a4909ab246eaf3d4",Z="交易账户余额",ba="<p><span>交易金额是针对机构来说的产生交易的现金余额</span></p><p><span>已支付状态下的机构扫码充值和管理员账户充值、已退款状态下的后台开课和用户订单，值为正数，</span></p><p><span>否则为负数，正数用红色字体标识，负数用绿色字体标识</span></p>",bb="7",bc="d613f3dc62714f6b945c46e2108d7a49",bd="订单备注",be="<p><span>读取交易的时候输入的备注（包含退款说明）</span></p>",bf="8",bg="590f8d20b7d24e81bbf772c67a0ffe4f",bh="交易现金",bi="<p><span>交易现金是机构跟平台产生现金交易的数据，针对平台来说的，支付为正数，退款为负数，后台开课和用户订单不产生现金交易的不用显示</span></p>",bj="style",bk="baseStyle",bl="627587b6038d43cca051c114ac41ad32",bm="pageAlignment",bn="center",bo="fill",bp="fillType",bq="solid",br="color",bs=0xFFFFFFFF,bt="image",bu="imageAlignment",bv="near",bw="imageRepeat",bx="auto",by="favicon",bz="sketchFactor",bA="0",bB="colorStyle",bC="appliedColor",bD="fontName",bE="Applied Font",bF="borderWidth",bG="borderVisibility",bH="borderFill",bI=0xFF797979,bJ="cornerRadius",bK="cornerVisibility",bL="outerShadow",bM="on",bN=false,bO="offsetX",bP=5,bQ="offsetY",bR="blurRadius",bS="spread"